import React, { useState } from 'react';
import './Footer2.css'; // Import CSS for styling
import FooterSection from './components/footerSection'; // Assuming this is a reusable section

function Footer() {
  const [email, setEmail] = useState('');
  const [message, setMessage] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    // Simple email validation
    if (!email) {
      setMessage('Please enter a valid email.');
      return;
    }

    // Here you would send the email to a backend or use an API service (like EmailJS)
    setMessage('Thank you for subscribing!');
    setEmail('');
  };

  return (
    <footer className="footer">
      {/* <FooterSection /> Reusable section if needed */}

      {/* Contact Section */}
      <div className="footer-section">
        <h3>Contact</h3>
        <ul>
          <li>
            Email: <a href="mailto:saurabhsk4u@gmail.com">rsengineering@gmail.com</a>
          </li>
          <li>
            Phone: <a href="tel:+911125532553">011-25532553</a>
          </li>
        </ul>
      </div>

      {/* Follow Us Section */}
      <div className="footer-section">
        <h3>Follow Us</h3>
        <ul>
          <li><a href="https://facebook.com" target="_blank" rel="noopener noreferrer">Facebook</a></li>
          <li><a href="https://twitter.com" target="_blank" rel="noopener noreferrer">Twitter</a></li>
          <li><a href="https://instagram.com" target="_blank" rel="noopener noreferrer">Instagram</a></li>
        </ul>
      </div>

      {/* Quick Links */}
      <div className="footer-section">
        <h3>Quick Links</h3>
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/about">About</a></li>
          <li><a href="/services">Services</a></li>
          <li><a href="/contact">Contact</a></li>
        </ul>
      </div>

      {/* Legal Section */}
      <div className="footer-section">
        <h3>Legal</h3>
        <ul>
          <li><a href="/terms">Terms of Service</a></li>
          <li><a href="/privacy">Privacy Policy</a></li>
        </ul>
      </div>

      {/* Newsletter Subscription Section */}
      <div className="footer-section3">
        <h3>Subscribe to Our Newsletter</h3>
        <form onSubmit={handleSubmit}>
          <label htmlFor="email" className="sr-only">Email Address</label>
          <input
            type="email"
            id="email"
            name="email"
            placeholder="Enter your email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
            required
            aria-label="Email address"
          />
          <button type="submit">Subscribe</button>
        </form>
        {message && <p>{message}</p>}
      </div>

      {/* Address Section */}
      <div className="footer-section">
        <h3>Address</h3>
        <p>72 Rohini</p>
      </div>

      {/* Support Section */}
      <div className="footer-section">
        <h3>Support</h3>
        <ul>
          <li><a href="/faq">FAQ</a></li>
          <li><a href="/support">Support Center</a></li>
        </ul>
      </div>

      {/* Partners Section */}
      <div className="footer-section">
        <h3>Partners</h3>
        <ul>
          <li>
            <a href="https://www.chnt.com" target="_blank" rel="noopener noreferrer">CHNT</a>
          </li>
          <li>
            <a href="https://www.se.com/in/en/product-category/1500-contactors-and-protection-relays/?filter=business-1-industrial-automation-and-control" target="_blank" rel="noopener noreferrer">Schneider Electric</a>
          </li>
        </ul>
      </div>

      {/* Newsletter Update Section */}
      <div className="footer-section">
        <h3>Newsletter</h3>
        <p>Our newsletter is coming soon!</p>
      </div>
    </footer>
  );
}

export default Footer;
